import Bar from "../../components/bar";
import Hamburguer from "../../components/hamburguer";
import { MainContainer } from "./styles.js";

const Dashboard = () => {
  return (
    <Area>
      <Bar />
      <MainContainer>
        <div className="Container">
          <Hamburguer />
        </div>
      </MainContainer>
    </Area>
  );
};

export default Dashboard;
